import "./App.css";
import { Box, ChakraProvider, extendTheme } from "@chakra-ui/react";
import HomePage from "../src/Pages/HomePage";
// import fonts
import "@fontsource/montserrat";
import "@fontsource/poppins";

function App() {
  const theme = extendTheme({
    fonts: {
      heading: "montserrat",
      // body: `'Raleway', sans-serif`,
    },
  });

  return (
    <>
      <ChakraProvider>
        <Box>
          <HomePage />
        </Box>
      </ChakraProvider>
    </>
  );
}

export default App;
